import Heading from './Heading'
import Bookings from "./Bookings";
import "./App.css";
import TouristInfoCard from "./TouristInfoCards";
import Footer from "./Footer";
import Restaurant from './Restaurant';

const App = () => {
  return (
    <div className="App">
      <Heading />
      <TouristInfoCard />

      <Bookings />
      <Restaurant />
      <Footer />
    </div>
  );
};

export default App;
